import cloudy from './img/cloudy.jpg';
import TextField from '@mui/material/TextField';


const WeatherApp = () => {
    return (
        <div className="WeatherAppDiv" >
            <div className="componentsDiv" >
                <h1>My Weather App</h1>

                <input placeholder="Enter your country/city ..." className="inputField"/>

                <h1></h1>
            </div>
        </div>
    )
}

// style={{ backgroundImage: `url(${cloudy})` }}

